-- ============================================================================
-- 多言語カードデータインポートSQL
-- 生成日: 2025-11-25
-- 対象レコード数: 2248
-- 対応言語: 英語(en), 韓国語(ko), 中国語繁体字(zh-TW), フランス語(fr), スペイン語(es), ドイツ語(de)
-- ============================================================================

BEGIN;

\echo '=== 多言語カードデータインポート開始 ==='

-- 一時テーブル作成
CREATE TEMP TABLE temp_multilingual_cards (
  id BIGINT,
  name_multilingual JSONB,
  image_url_multilingual JSONB
);

-- データ挿入

-- 既存のname_multilingualとimage_url_multilingualに新しい言語データをマージ
UPDATE cards
SET
  name_multilingual = cards.name_multilingual || temp.name_multilingual,
  image_url_multilingual = cards.image_url_multilingual || temp.image_url_multilingual
FROM temp_multilingual_cards temp
WHERE cards.id = temp.id;

-- 更新されたレコード数を確認
DO $$
DECLARE
  updated_count INT;
BEGIN
  SELECT count(*) INTO updated_count FROM cards c
  JOIN temp_multilingual_cards t ON c.id = t.id
  WHERE c.name_multilingual ? 'en' AND c.image_url_multilingual ? 'en';
  
  RAISE NOTICE '更新されたレコード数: %', updated_count;
  
  IF updated_count <> 2248 THEN
    RAISE WARNING '期待されたレコード数(2248)と実際の更新数(%)が一致しません', updated_count;
  END IF;
END $$;

-- 一時テーブル削除
DROP TABLE temp_multilingual_cards;

-- サンプル確認（最初の5件）
SELECT id, name, name_multilingual, image_url_multilingual
FROM cards
WHERE id IN (3101, 3102, 3103, 3104, 3105)
ORDER BY id;

COMMIT;

\echo '=== 多言語カードデータインポート完了 ==='

-- ============================================================================
-- 完了
-- ============================================================================